import React, { useState, useEffect } from "react";
import Header from "../components/Header";
import firstletterCap from "../utills/firstletterCap";
import {
	Container,
	Col,
	Row,
	Card,
	CardHeader,
	CardBody,
	Collapse,
} from "reactstrap";
import API from "../utills/Api";
import { Table, Button } from "react-bootstrap";
import "./css/TrainModel.css";
import UserModelInput from "../components/UserModelInput";
const TrainModel = () => {
	const [Modelname, setModelname] = useState("");
	const [cityName, setCityName] = useState("");
	const [stateName, setStateName] = useState("");
	const [useModel, setUseModel] = useState("");
	const [SelectedFile, setSelectedFile] = useState(false);
	const [toggleQuestion, setToggequestion] = useState(1);
	const [isAuth, setisAuth] = useState();
	const [ModelNames, setModelNames] = useState([]);
	useEffect(() => {
		async function checkLogin() {
			let response = await API.get("/check", {
				headers: {
					"x-access-tokens": localStorage.getItem("jwt"),
				},
			});
			response = await response;
			let res_data = { ...response.data };
			console.log(res_data);
			if (res_data.isAuthenticated) {
				setisAuth(true);
			}
		}
		checkLogin();
	}, []);
	useEffect(() => {
		async function getTrainedModels() {
			let response = await API.get("/user_models", {
				headers: {
					"x-access-tokens": localStorage.getItem("jwt"),
				},
			});
			response = await response;
			let res_data = response.data.names;
			setModelNames(res_data);
		}
		getTrainedModels();
	}, [isAuth]);

	const onSubmit = async (e) => {
		e.preventDefault();
		const form = new FormData();
		console.log(SelectedFile);
		form.append("csvfile", SelectedFile, "csvfile");
		form.append("model_name", Modelname);
		form.append("city_name", cityName);
		form.append("state", stateName);
		await API.post("/personal_model", form, {
			headers: {
				"Content-Type": "multipart/form-data,",
				"x-access-tokens": localStorage.getItem("jwt"),
			},
		})
			.then((res) => {
				console.log(res);
			})
			.catch((err) => {
				console.log(err);
			});
	};

	return (
		<>
			<Header
				title='Find The Real Price!'
				desc1='This is a simple hero unit, a simple Jumbotron-style component
								for calling extra attention to featured content or information.'
				desc2='It uses utility classes for typography and spacing to space
                content out within the larger container.'
			/>
			{isAuth ? (
				<>
					<Container fluid className='contant-container'>
						<Container fluid>
							<Row>
								<Col>
									<Card className='train-cards-collapse'>
										<CardHeader
											style={{ textAlign: "center" }}
											onClick={() => setToggequestion(1)}>
											<span style={{ fontSize: "40px" }}>How To Use</span>
										</CardHeader>
										<Collapse isOpen={toggleQuestion === 1 ? true : false}>
											<CardBody>
												For further accuracy Improvements we had given the
												option of prediction for specific data for the
												authenticated user.User can train his/her personal model
												and get its prediction.User have to upload csv file in
												the given format. Csv file limitation: It must be less
												than 15 mb. It should contains the 12 columns and all
												the 12 columns should be in order. The value of each
												column has to be valid other wise model training is not
												possible. The user should upload valid csv file.
											</CardBody>
										</Collapse>
									</Card>

									<Card className='train-cards-collapse'>
										<CardHeader
											style={{ textAlign: "center" }}
											onClick={() => setToggequestion(2)}>
											<span style={{ fontSize: "40px" }}>
												Train A New Model
											</span>
										</CardHeader>
										<Collapse isOpen={toggleQuestion === 2 ? true : false}>
											<CardBody>
												<Container>
													<form>
														<div class='form-group'>
															<label for='exampleInputEmail1'>
																Name Your Model
															</label>
															<input
																class='form-control'
																placeholder='Model Name'
																type='text'
																value={Modelname}
																onChange={(e) => setModelname(e.target.value)}
															/>
														</div>
														<div class='form-group'>
															<label for='exampleInputEmail1'>City</label>
															<input
																class='form-control'
																placeholder='City (Spelling and Case Sensitive)'
																type='text'
																value={cityName}
																onChange={(e) => setCityName(e.target.value)}
															/>
														</div>
														<div class='form-group'>
															<label for='exampleInputEmail1'>State</label>
															<input
																class='form-control'
																placeholder='State (Spelling and Case Sensitive)'
																type='text'
																value={stateName}
																onChange={(e) => setStateName(e.target.value)}
															/>
														</div>
														<div class='form-group'>
															<label for='csvupload'>Upload CSV</label>
															<input
																class='form-control'
																placeholder='Upload FIle'
																type='file'
																name='CSV'
																onChange={(e) =>
																	setSelectedFile(e.target.files[0])
																}
															/>
														</div>
														<button
															type='submit'
															onClick={(e) => onSubmit(e)}
															class='btn btn-primary'>
															Submit
														</button>
													</form>
												</Container>
											</CardBody>
										</Collapse>
									</Card>
								</Col>
							</Row>
						</Container>
					</Container>
					<Container fluid className='contant-container'>
						<Row>
							<Col>
								<Card className='train-cards-collapse'>
									<CardHeader
										style={{ textAlign: "center" }}
										onClick={() => setToggequestion(3)}>
										<span style={{ fontSize: "40px" }}>
											Your Trained Models
										</span>
									</CardHeader>
									<Container>
										<Row>
											<Col>
												<CardBody>
													<Table striped bordered hover>
														<thead>
															<tr>
																<th>#</th>
																<th>Model Name</th>
																<th>Use Model</th>
															</tr>
														</thead>
														<tbody>
															{ModelNames.map((nmx, idx) => {
																console.log(ModelNames);
																console.log(nmx);
																return (
																	<tr>
																		<td>{idx + 1}</td>
																		<td>{firstletterCap(nmx)}</td>
																		<td>
																			<Button
																				onClick={(e) => {
																					e.preventDefault();
																					setUseModel(nmx);
																				}}
																				color='primary'>
																				Use {firstletterCap(nmx)} Model
																			</Button>
																		</td>
																	</tr>
																);
															})}
														</tbody>
													</Table>
												</CardBody>
											</Col>
										</Row>
									</Container>
								</Card>
							</Col>
						</Row>
					</Container>
					{useModel ? (
						<Container fluid className='contant-container'>
							<Row>
								<Col>
									<UserModelInput ModelName={useModel} />
								</Col>
							</Row>
						</Container>
					) : null}
				</>
			) : null}
		</>
	);
};

export default TrainModel;
